import React, { Component } from 'react';
import { Image } from 'react-native';
import styles from './Home.module.css';
import instagram from '../Images/instagram_icon.png';
import linkedin from '../Images/linkedin_icon.png';
import mail from '../Images/mail_icon.png';
import mailinglist from '../Images/mailinglist_icon.png';
import twitter from '../Images/twitter_icon.png';

class Home extends Component {
  render() {
    return (
      <div className={styles.full}>
      <div className={styles.clubName}>Black Women's Alliance</div>

      <div className={styles.contactBar}>
        <a className={styles.contactBarCol}href="https://www.instagram.com/mit_bwa/?hl=enn">
          <img className={styles.insideCol} src={instagram} />
        </a>

        <a className={styles.contactBarCol}href="https://www.instagram.com/mit_bwa/?hl=enn">
          <img className={styles.insideCol} src={twitter} />
        </a>

        <a className={styles.contactBarCol}href="https://www.instagram.com/mit_bwa/?hl=enn">
          <img className={styles.insideCol} src={linkedin} />
        </a>

        <a className={styles.contactBarCol}href="https://www.instagram.com/mit_bwa/?hl=enn">
          <img className={styles.insideCol} src={mail} />
        </a>

        <a className={styles.contactBarCol}href="https://www.instagram.com/mit_bwa/?hl=enn">
          <img className={styles.mailingList} src={mailinglist} />
        </a>
      </div>

      </div>
    );
  }
}
export default Home;
